// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "./IotaHeroFactory.sol";

contract IotaHeroesMarket is Ownable {
    IotaHeroFactory public heroToken;

    Trade[] public trades;
    uint256 tradeCounter = 0;

    enum TradeStatus {
        OPEN,
        FULFILLED,
        CANCELLED
    }
    struct Trade {
        uint256 tradeId;
        address tradeInitiator;
        uint256 itemId;
        uint256 price;
        TradeStatus tradeStatus;
    }

    mapping(uint256 => address) public tradeToOwner;
    mapping(uint256 => uint256) public heroIdToTradeId;
    mapping(uint256 => bool) public heroIdForSale;

    event TradeCreated(
        uint256 indexed tradeId,
        address indexed creator,
        uint256 tokenId,
        uint256 price
    );

    event TradeUpdated(
        uint256 indexed tradeId,
        address indexed updater,
        TradeStatus updatedStatus
    );

    modifier onlyOwnerOf(uint256 _tradeId) {
        require(tradeToOwner[_tradeId] == msg.sender);
        _;
    }

    function setTokenAddress(address _tokenAddress) public onlyOwner {
        heroToken = IotaHeroFactory(_tokenAddress);
    }

    function getTokenAddress() public view returns (address) {
        return address(heroToken);
    }

    function listTrade(uint256 _itemId, uint256 _price) public {
        require(
            heroToken.isApprovedForAll(msg.sender, address(this)),
            "You must approve first"
        );
        require(
            msg.sender == heroToken.ownerOf(_itemId),
            "You do not own this token"
        );
        require(_price > 0, "Price must be higher than 0");
        if (heroIdForSale[_itemId]) {
            uint256 tradeId = heroIdToTradeId[_itemId];
            Trade storage existingTrade = trades[tradeId];
            existingTrade.tradeStatus = TradeStatus.CANCELLED;
        }

        Trade memory trade = Trade(
            tradeCounter,
            msg.sender,
            _itemId,
            _price,
            TradeStatus.OPEN
        );
        trades.push(trade);
        heroIdForSale[_itemId] = true;
        heroIdToTradeId[_itemId] = tradeCounter;
        tradeToOwner[tradeCounter] = msg.sender;
        emit TradeCreated(tradeCounter, msg.sender, _itemId, _price);
        tradeCounter++;
    }

    function cancelTrade(uint256 _tradeId) public onlyOwnerOf(_tradeId) {
        Trade storage trade = trades[_tradeId];
        require(
            trade.tradeStatus == TradeStatus.OPEN,
            "This trade is not currently open"
        );
        trade.tradeStatus = TradeStatus.CANCELLED;
        heroIdForSale[trade.itemId] = false;

        emit TradeUpdated(_tradeId, msg.sender, TradeStatus.CANCELLED);
    }

    function fulfillTrade(uint256 _tradeId) public payable {
        Trade storage trade = trades[_tradeId];
        require(
            trade.tradeStatus == TradeStatus.OPEN,
            "Trade isn't active anymore"
        );
        require(
            trade.tradeInitiator != msg.sender,
            "You can't fulfill your own trades"
        );
        require(msg.value >= trade.price, "Payment too low");
        trade.tradeStatus = TradeStatus.FULFILLED;
        heroToken.safeTransferFrom(
            trade.tradeInitiator,
            msg.sender,
            trade.itemId
        );
        heroIdForSale[trade.itemId] = false;
        emit TradeUpdated(_tradeId, msg.sender, TradeStatus.FULFILLED);
    }

    function getTradeForItem(uint256 _itemId)
        public
        view
        returns (Trade memory)
    {
        if (heroIdForSale[_itemId]) {
            return trades[heroIdToTradeId[_itemId]];
        } else {
            Trade memory empty;
            return empty;
        }
    }

    function getOpenTrades() public view returns (Trade[] memory) {
        uint256 resultCount;
        for (uint256 i = 0; i < trades.length; i++) {
            if (trades[i].tradeStatus == TradeStatus.OPEN) {
                resultCount++;
            }
        }
        Trade[] memory openTrades = new Trade[](resultCount);
        uint256 c = 0;
        for (uint256 i = 0; i < trades.length; i++) {
            if (trades[i].tradeStatus == TradeStatus.OPEN) {
                openTrades[c] = trades[i];
                c++;
            }
        }
        return openTrades;
    }

    function withdraw() public onlyOwner {
        payable(msg.sender).transfer(address(this).balance);
    }
}
